  false,\n\t\"url\": null,\n\t\"notes\": \"A non-game Grassland Survey was performed
  in the summer of 2003 on 42 Waterfowl Production Areas (WpAs) in the Devils Lake
  Wildlife Management District (DLWMD) in Northeastern North Dakota. The purpose of
  this survey was to investigate both diversity and the overall abundance of the grassland
  bird species that inhabit these WPA's.  This report is on the methods, results and
  discussion of the grassland bird surveys performed.\",\n\t\"license_title\": \"License
